    false,nt"url": null,nt"notes": "The NOAA Hypoxia Watch project provides
    near-real-time, web-based maps of dissolved oxygen near the sea floor over the Texas-Louisiana
    continental shelf during a period that extends from early June to mid-July. The
    NOAA National Marine Fisheries Service Mississippi Laboratories at Pascagoula and
    Stennis Space Center and the NOAA National Coastal Data Development Center (NCDDC)
    at Stennis Space Center began the Hypoxia Watch project in 2001. Scientists aboard
    the NOAA Research Vessel Oregon II measure seawater properties, such as water temperature,
    salinity, chlorophyll, and dissolved oxygen at each of approximately 240 locations
    as the Oregon II cruises the waters south of Pascagoula, MS and then makes its way
    from Brownsville, Texas, to the mouth of the Mississippi River. A scientist aboard
    the ship processes the measurements from electronic dissolved oxygen sensors, checks
    the measurements periodically with chemical analyses of the seawater, then sends
    the data by e-mail to NCDDC at Stennis Space Center approximately every three to
    five days. Physical Scientists at NCDDC transform the dissolved oxygen measurements
    into contour maps, which identify areas of low oxygen, or hypoxia. During the 6-week
    cruise, as the data is received from the ship, NCDDC generates new maps and immediately
    publishes them on the web. The first map will usually cover an area off the Mississippi
    coast, successive maps will add areas of the continental shelf from Brownsville
    to Galveston, and the final map will usually cover the entire Texas-Louisiana-Mississippi
    coast. The 2009 summer cruise extended eastward to areas off the coast of Alabama
    and Florida during Leg 3. Maps are published every three to five days from approximately
    June 10 to July 20.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
